import React from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min';

import DateService from '../services/date.service';
import ProfessionalService from '../services/professional.service'

import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

class homeComponent extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            dates: [],
            id: sessionStorage.getItem("userId"),
            email: sessionStorage.getItem("userEmail")
        };
    }

    componentDidMount(){
        this.loadUserId();
        this.showTodayDates();
    }

    async loadUserId(){
        await ProfessionalService.getWithEmail({ email: this.state.email })
            .then(res => {
                if (res.data.success) {
                    const {id} = res.data.data[0];
                    sessionStorage["userId"] = id;
                } else {
                    console.error('Error loading Id');
                }
            })
            .catch(err => {
                console.error('ERROR server' + err);
            });
    }

    showTodayDates() {
        DateService.getConfirmedDatesWithProfessionalId({id:this.state.id})
            .then(res => {
                console.log(res.data.data);
                if (res.data.success) {
                    const data = res.data.data;
                    this.setState({ dates: data });
                } else {
                    console.error('Error loading dates service');
                }
            })
            .catch(err => {
                console.error('ERROR server' + err);
            });
    }

    render() {
        return (
            <div className="container">
                <div className="row my-5 mx-3" >
                    <table className="table table-bordered table-striped">
                        <thead>
                            <tr>
                                <th scope="col">Fecha</th>
                                <th scope="col">Hora</th>
                                <th scope="col">Correo</th>
                                <th scope="col">Tipo</th>
                            </tr>
                        </thead>
                        <tbody>
                            {this.loadFillData()}
                        </tbody>
                    </table>
                </div>
                <div className="row m-5">
                    <div className="col-lg-12">
                        <div className="card">
                            <div className="card-body">
                                <div class="container">
                                    <div class="row">
                                        <div class="col-sm">
                                            <h3>Lunes</h3>
                                        </div>
                                        <div class="col-sm">
                                            <label className="float-left">Desde </label>
                                            <div className="w-10">
                                                <DatePicker
                                                    selected={this.state.monday.myDateFrom}
                                                    onChange={time => this.handleChange(time, 'mondayFrom')}
                                                    showTimeSelect
                                                    showTimeSelectOnly
                                                    timeIntervals={this.state.periodLenght}
                                                    timeCaption="Time"
                                                    dateFormat="h:mm aa"
                                                />
                                            </div>
                                        </div>
                                        <div class="col-sm">
                                            <label className="float-left">Hasta </label>
                                            <DatePicker
                                                selected={this.state.monday.myDateTo}
                                                onChange={time => this.handleChange(time, 'mondayTo')}
                                                showTimeSelect
                                                showTimeSelectOnly
                                                timeIntervals={this.state.periodLenght}
                                                timeCaption="Time"
                                                dateFormat="h:mm aa"
                                            />
                                        </div>
                                        <div class="col-sm">
                                            <button type="button" class="btn btn-primary m-1"
                                                onClick={() => this.addPeriod('monday')}>AÃ±adir</button>
                                            <button type="button" class="btn btn-danger m-1"
                                                onClick={() => this.emptyPeriod('monday')}>Vaciar</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }

    loadFillData(){
        return this.state.dates.map(each => {
            if (each) {
                console.log(each);
                return (
                    <tr>
                        <td >{each.date}</td>
                        <td >{each.time}</td>
                        <td >{each.email}</td>
                        <td >{each.dateType.name}</td>
                    </tr>
                );
            }
        });
    }
}

export default homeComponent;
